import React, { useState, useEffect } from 'react';

function Teams() {
  const [teams, setTeams] = useState([]);

  useEffect(() => {
    fetch('../db/data.json')
      .then(response => response.json())
      .then(data => {
        setTeams(data);
        console.log(data);
      });
  }, []);

  return (
    <div>
        <h2>Teams</h2>
    </div>
  );
}

export default Teams
